	@echo "Building Clover..."
	@./ebuild.sh -gcc53 -D LESS_DEBUG -D NO_GRUB_DRIVERS_EMBEDDED >/dev/null
	@echo [BUILD] "Clover " $Version.h

clean:
	@./ebuild.sh -gcc53 -clean >/dev/null
	@rm -rf build *~
	@echo [CLEAN] 

